Технологический справочник, который используется для объединения 2 вариантов по 3 группы элементов:
а) наборы групп доступа, наборы групп пользователей, пользователи;
б) наборы групп доступа, наборы групп внешних пользователей, внешние пользователи.

Ein Technologieleitfaden, der verwendet wird, um 2 Optionen in 3 Gruppen von Elementen zu kombinieren:
a) Zugriffsgruppen-Sets, Benutzergruppen-Sets, Benutzer;
b) Zugriffsgruppen-Sets, externe Benutzergruppen-Sets, externe Benutzer.

3'er grup öğe 2 seçeneğin birleşmesi için kullanılan teknolojik kılavuz: 
a) erişim grupları kümeleri, kullanıcı grupları kümeleri, kullanıcılar; 
b) erişim grupları kümeleri, dış kullanıcılar grupları kümeleri, harici kullanıcılar.

Catálogo tecnológico que se usa para unir 2 opciones por 3 grupos de elementos:
a) conjuntos de grupos de acceso, conjuntos de grupos de usuarios, usuarios;
b) conjuntos de grupos de acceso, conjuntos de grupos de usuarios externos, usuarios externos.
